app.controller("profileController",["$scope",e=>{e.init=((t,r)=>{e.amazon_base_url=t;let o=JSON.parse(r);e.i18n_myAdsTitle=o.myAds.title,e.i18n_no_results=o.myAds.no_results,e.i18n_settings=o.myAds.settings,e.i18n_update=o.myAds.update,e.i18n_edit=o.myAds.edit,e.i18n_new_event=o.myAds.new_event,e.i18n_buy_power=o.myAds.buy_power,e.i18n_unpublish=o.myAds.unpublish,e.i18n_myEventsTitle=o.myEvents.title,e.i18n_messagesTitle=o.messages.title,e.i18n_searchPlaceholder=o.messages.search,e.i18n_favTitle=o.favourites.title,e.i18n_buyPower_title=o.buyPower.title,e.i18n_power_up_text1=o.buyPower.power_up_text1,e.i18n_power_up_text2=o.buyPower.power_up_text2,e.i18n_buy_power_btn=o.buyPower.buy_power_btn,e.i18n_bought_power_message=o.buyPower.bought_power_message})}]),app.config(["$routeProvider",e=>{e.when("/myads",{templateUrl:"partials/profile/myads.jade",controller:"myAdsController"}).when("/myevents",{templateUrl:"partials/profile/myevents.jade",controller:"myEventsController"}).when("/buypower/:id",{templateUrl:"partials/profile/buyPower.jade",controller:"buyPowerController"}).when("/messages/:id?",{templateUrl:"partials/profile/messages.jade",controller:"messagesController"}).when("/myfavourites",{templateUrl:"partials/profile/myFavourites.jade",controller:"myFavouritesController"}).when("/profileEdit",{templateUrl:"partials/profile/profileEdit.jade",controller:"profileEditController"}).otherwise({redirectTo:"/myads"})}]).run(["$rootScope","$location",function(e,t){e.$watch(function(){return t.path()},t=>{e.activetab=t.split("/")[1]})}]);